import React, { useEffect } from 'react'
import Carddata from './carddata'
import data from './data'
useEffect(()=>{
  alert()
},[])
function Card(){
  document.body.style.backgroundColor="lightgrey"
  return (
    <div>
      <div style={{textAlign:"center",backgroundColor:"lightgray",color:"darkblue"}}>
        <h1>Welcome to My Anime Page</h1>
      </div>
        {data.map((val)=>(
            <Carddata
                key={val.id}
                products={val}
            />
        ))}
    </div>
  )
}

export default Card
